	local this = 0
	for _ in _loop_() do
		this = s__ModSpeed_next[this]
		if this == 0 then break end
		if GetWidgetLife(s__ModSpeed_u[this]) < 0.405 then
			s__ModSpeed_destroy(this)
		else
			s__ModSpeed_move(this)
		end
	end
end
