function UniMissileSystem3D__MLoop()
	local i = UniMissileSystem3D__Top
	local x = _array_(0.0)
	local y = _array_(0.0)
	local zLoc = _array_(0.0)
	local h = 0.0
	local h2 = 0.0
	local time = 0.0
	local ttime = 0.0
	local ang = 0.0
	local height = 0.0
	local lastheight = 0.0
	local addxy = 0.0
	local addz = 0.0
	local anglez = 0.0
	local tanZ = 0.0
	local addh = 0.0
	local udis = 0.0
	local targetheight = 0.0
