				UniMissileSystem3D__AN[i] = UniMissileSystem3D__AngleBetweenXY(x[1], GetUnitX(UniMissileSystem3D__MT[i]), y[1], GetUnitY(UniMissileSystem3D__MT[i]))
				ang = UniMissileSystem3D__AN[i] * bj_DEGTORAD
