function YDWEStringFormula__Convert(value, length)
	local Char = I2S(value)
	local slen = StringLength(Char)

	for _ in _loop_() do
		if slen >= length then break end
		Char = "0" .. (Char or "")
		slen = slen + 1
	end

	return Char
end


