function knock_back(u, angle, dist, time, period, model, shanghai)
	local t = CreateTimer()
	local p = GetHandleId(t)
	local m = R2I(time / period)
	dist = dist / m --  ÂçïÊ¨°‰ΩçÁßªË∑ùÁ¶ª
	SaveUnitHandle(YDHT, p, 0, u) --  Â≠òÂÇ®Ë¢´ÂáªÈÄÄÂçï‰Ωç
	SaveInteger(YDHT, p, 1, 0) --  Â≠òÂÇ®Âæ™ÁéØËÆ°Êï∞
	SaveInteger(YDHT, p, 2, m) --  Â≠òÂÇ®Ê¨°Êï∞
	SaveReal(YDHT, p, 3, dist * Cos(angle)) --  Â≠òÂÇ®xËΩ¥ÈÄüÂ∫¶ÂàÜÈáè
	SaveReal(YDHT, p, 4, dist * Sin(angle)) --  Â≠òÂÇ®yËΩ¥ÈÄüÂ∫¶ÂàÜÈáè
	SaveStr(YDHT, p, 5, model)
	SaveReal(YDHT, p, 6, shanghai) --Â≠òÂÇ®‰º§ÂÆ≥
	TimerStart(t, period, true, knock_back_on_timer)
	t = nil
end
