	if i_naji ~= 0 then
		for _ in _loop_() do
			z_naji = i_naji - i_naji // 256 * 256
			i_naji = i_naji // 256
			Sdummy_naji[100] = (SubString(StringList_naji, z_naji, z_naji + 1) or "") .. (Sdummy_naji[100] or "")
