function KeyInputSystem()
	local t = CreateTrigger()
	local i = 0
	for _ in _loop_() do
		if i > 6 then break end
		TriggerRegisterPlayerChatEvent(t, Player(i), "", true)
		i = i + 1
	end
	TriggerAddAction(t, KeyInput)
	t = nil
end
