	local firstpass = LoadBoolean(YDHT, p, 9)
	local loc = GetUnitLoc(l__ut)
	local g = CreateGroup()
	SetUnitX(l__ut, CheckX(Axx * a * a + Bxx * 2 * a * b + Cxx * b * b))
